import Link from "next/link";
import Layout from "../components/Layout";

export default () => {
    return (
        <Layout>
            <ul>
                <li>
                    <Link href="/post?title=react">
                        <a>React Post</a>
                    </Link>
                </li>
            </ul>
        </Layout>
    );
}
